import Litepicker from "./litepicker/Main.vue";

import {
    Dropdown,
    DropdownToggle,
    DropdownMenu,
    DropdownContent,
    DropdownItem,
    DropdownHeader,
    DropdownFooter,
    DropdownDivider,
  } from "./dropdown";



export default (app) => { 
    app.component("Litepicker", Litepicker);

}
